INSERT INTO `v1_831c3dda5f7011eb7ec5cf6972a510a4062280a5987b3146f121192cca6315c1` VALUES (0, 0, "今日は何の日か、もちろん分かるよね？\nこの世で一番かわいくて美しいボクが\n誕生して、みんなの美意識が刷新された\nことをお祝いする、世界的記念日だよ♪", 11, 1, 23814070, 1, 10, 100811, 0.5, 23814);
